import React from 'react';
import { ReactComponent as CarSvg } from '../images/araba.svg'; // Assuming car.svg is in the same directory
import Yollar from '../images/yollar.png'
const MyComponent = () => {
  return (
    <div style={{ position: 'absolute', width: '600px', height: '600px', backgroundColor:'green', left:'25%' }}>
      <img 
        src= {Yollar} 
        alt="road" 
        style={{ 
          width: '100%', 
          height: '100%',
          position: 'absolute',
          zIndex: 1
        }}
      />
      <CarSvg 
        style={{ 
          width: '25px', 
          height: '25px',
          position: 'absolute',
          left: '315px',  // adjust this value to move car horizontally
          top: '560px',   // adjust this value to move car vertically
          zIndex: 2
        }} 
      />
    </div>
  );
}

export default MyComponent;
